import React from 'react'
import ob from './Grouptext.module.css'
import Text from './Text/Text'

const Grouptext = () => {
    return (
        <div>
            <ul className={ob.ul}>
                    <Text text="Парковка"/>
                    <Text text="Страховка"/>
                    <Text text="Бензин"/>
                    <Text text="Обслуживание"/>
                </ul>
        </div>
    )
}


export default Grouptext;
